import React from "react"
import User from "./User"

class Users extends React.Component {
constructor(props) {
  super(props)
}
  render() {
    if(this.props.users.length > 0)
    return (
        <div>
          {this.props.users.map((el) => (<User key={el.id} user={el}/>))}
        </div>
    )
    else
    return (
      <div className="user">
        <h3>Пользователей нет</h3>
      </div>
    )
  }

}

export default Users
